INSERT INTO "course" ("id", "title", "description", "instructor", "associatedWorkshop", "maxStudents", "enrolledStudents", "totalWeeks", "totalModules", "status", "createdAt", "updatedAt") VALUES (2, 'Abnormal Psychology & Disorders', 'Study of psychological disorders, diagnostic criteria, and current treatment approaches. Focus on understanding the complexity of mental health conditions.', 'Dr. Akanksha Agarwal', 'unboxing_psychology', 30, 10, 1, 1, 'ACTIVE', '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "course" ("id", "title", "description", "instructor", "associatedWorkshop", "maxStudents", "enrolledStudents", "totalWeeks", "totalModules", "status", "createdAt", "updatedAt") VALUES (3, 'Cognitive Processes & Thinking', 'Exploration of cognitive processes including perception, attention, memory, language, and decision-making.', 'Dr. Akanksha Agarwal', 'unboxing_psychology', 30, 10, 1, 1, 'ACTIVE', '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "course" ("id", "title", "description", "instructor", "associatedWorkshop", "maxStudents", "enrolledStudents", "totalWeeks", "totalModules", "status", "createdAt", "updatedAt") VALUES (4, 'Social Influence & Behavior', 'Study of how others influence our thoughts, feelings, and behaviors, including conformity, obedience, and group dynamics.', 'Dr. Akanksha Agarwal', 'unboxing_psychology', 30, 10, 1, 1, 'ACTIVE', '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "course" ("id", "title", "description", "instructor", "associatedWorkshop", "maxStudents", "enrolledStudents", "totalWeeks", "totalModules", "status", "createdAt", "updatedAt") VALUES (5, 'Brain & Behavior Connections', 'Exploration of the biological bases of behavior, including neural mechanisms, neurochemistry, and the influence of genetics.', 'Dr. Akanksha Agarwal', 'unboxing_psychology', 30, 10, 1, 1, 'ACTIVE', '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "course" ("id", "title", "description", "instructor", "associatedWorkshop", "maxStudents", "enrolledStudents", "totalWeeks", "totalModules", "status", "createdAt", "updatedAt") VALUES (6, 'Personality Theories & Assessment', 'Overview of major personality theories and approaches to personality assessment.', 'Dr. Akanksha Agarwal', 'unboxing_psychology', 30, 10, 1, 1, 'ACTIVE', '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "course" ("id", "title", "description", "instructor", "associatedWorkshop", "maxStudents", "enrolledStudents", "totalWeeks", "totalModules", "status", "createdAt", "updatedAt") VALUES (7, 'Psychology of Health & Wellness', 'Study of psychological factors in health, illness, and healthcare, including stress, coping, and health behaviors.', 'Dr. Akanksha Agarwal', 'unboxing_psychology', 30, 10, 1, 1, 'ACTIVE', '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "course" ("id", "title", "description", "instructor", "associatedWorkshop", "maxStudents", "enrolledStudents", "totalWeeks", "totalModules", "status", "createdAt", "updatedAt") VALUES (8, 'Well-being & Positive Emotions', 'Exploration of human strengths, virtues, and factors that contribute to a fulfilling life.', 'Dr. Akanksha Agarwal', 'unboxing_psychology', 30, 10, 1, 1, 'ACTIVE', '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "course" ("id", "title", "description", "instructor", "associatedWorkshop", "maxStudents", "enrolledStudents", "totalWeeks", "totalModules", "status", "createdAt", "updatedAt") VALUES (9, 'Cultural Perspectives in Psychology', 'Examination of how culture influences human behavior, cognition, emotion, and social interactions.', 'Dr. Akanksha Agarwal', 'unboxing_psychology', 30, 10, 1, 1, 'ACTIVE', '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "course" ("id", "title", "description", "instructor", "associatedWorkshop", "maxStudents", "enrolledStudents", "totalWeeks", "totalModules", "status", "createdAt", "updatedAt") VALUES (10, 'Learning & Educational Applications', 'Study of how people learn in educational settings, including cognitive, social, and motivational factors.', 'Dr. Akanksha Agarwal', 'unboxing_psychology', 30, 10, 1, 1, 'ACTIVE', '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
