INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (1, 'Piaget''s Cognitive Development Theory', 1, 'Detailed exploration of Piaget''s four stages of cognitive development: sensorimotor, preoperational, concrete operational, and formal operational.', 1, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (2, 'Erikson''s Psychosocial Development', 2, 'Analysis of Erikson''s eight stages of psychosocial development across the lifespan, focusing on identity formation and psychosocial crises.', 1, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (3, 'Attachment Theory', 3, 'Study of attachment patterns in early childhood and their impact on later relationships and emotional development.', 1, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (4, 'Mood Disorders', 1, 'Comprehensive overview of depressive and bipolar disorders, including symptoms, etiology, and treatment approaches.', 2, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (5, 'Anxiety Disorders', 2, 'Examination of various anxiety disorders including GAD, panic disorder, phobias, and OCD, with focus on cognitive and biological factors.', 2, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (6, 'Psychotic Disorders', 3, 'In-depth analysis of schizophrenia spectrum disorders, including positive and negative symptoms, neurocognitive aspects, and treatment challenges.', 2, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (7, 'Memory Processes', 1, 'Study of encoding, storage, and retrieval processes in memory, including working memory, long-term memory, and autobiographical memory.', 3, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (8, 'Attention and Consciousness', 2, 'Examination of attentional processes, selective attention, divided attention, and theories of consciousness.', 3, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (9, 'Language and Thought', 3, 'Analysis of language acquisition, processing, and the relationship between language and thought, including linguistic relativity.', 3, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (10, 'Social Conformity', 1, 'Examination of Asch''s conformity experiments, normative and informational influence, and factors affecting conformity.', 4, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (11, 'Obedience to Authority', 2, 'Analysis of Milgram''s obedience studies, factors influencing obedience, and ethical implications for society.', 4, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (12, 'Group Polarization', 3, 'Study of how group discussions can strengthen pre-existing attitudes and lead to more extreme positions.', 4, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (13, 'Neural Communication', 1, 'Study of neurons, action potentials, neurotransmitters, and synaptic transmission.', 5, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (14, 'Brain Structure and Function', 2, 'Examination of major brain regions and their specialized functions in cognition, emotion, and behavior.', 5, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (15, 'Genetics and Behavior', 3, 'Analysis of genetic influences on behavior, including heritability, gene-environment interactions, and epigenetics.', 5, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (16, 'Trait Theories', 1, 'Examination of trait approaches to personality, including the Five-Factor Model and biological bases of traits.', 6, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (17, 'Psychodynamic Theories', 2, 'Analysis of Freud''s psychoanalytic theory and neo-Freudian approaches to personality development.', 6, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (18, 'Humanistic Theories', 3, 'Study of Rogers'' person-centered approach and Maslow''s hierarchy of needs as frameworks for understanding personality.', 6, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (19, 'Stress Physiology', 1, 'Examination of physiological stress responses, including the HPA axis and sympathetic nervous system activation.', 7, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (20, 'Coping Mechanisms', 2, 'Analysis of problem-focused and emotion-focused coping strategies and their effectiveness in different situations.', 7, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (21, 'Health Behavior Change', 3, 'Study of models of health behavior change, including the Transtheoretical Model and Health Belief Model.', 7, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (22, 'Positive Emotions', 1, 'Study of the broaden-and-build theory of positive emotions and their role in resilience and well-being.', 8, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (23, 'Character Strengths', 2, 'Examination of the VIA classification of character strengths and their application in everyday life.', 8, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (24, 'Flow and Engagement', 3, 'Analysis of Csikszentmihalyi''s concept of flow and optimal experience in work and leisure activities.', 8, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (25, 'Individualism vs. Collectivism', 1, 'Analysis of cultural value dimensions and their impact on cognition, emotion, and social behavior.', 9, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (26, 'Cultural Neuroscience', 2, 'Exploration of cultural influences on brain development and neural processing of information.', 9, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (27, 'Culture and Mental Health', 3, 'Examination of cultural variations in psychopathology, help-seeking behaviors, and treatment effectiveness.', 9, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (28, 'Cognitive Learning Processes', 1, 'Study of information processing, working memory, and cognitive load theory in educational contexts.', 10, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (29, 'Motivation in Learning', 2, 'Examination of intrinsic and extrinsic motivation, self-determination theory, and achievement goal theory.', 10, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (30, 'Individual Differences', 3, 'Analysis of learning styles, multiple intelligences, and the role of personality in academic achievement.', 10, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (31, 'Leadership and Management', 1, 'Examination of leadership styles, transformational leadership, and evidence-based management practices.', 11, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (32, 'Employee Motivation', 2, 'Analysis of job satisfaction, organizational commitment, and theories of work motivation.', 11, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (33, 'Team Dynamics', 3, 'Study of group processes, team effectiveness, and virtual team collaboration.', 11, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (34, 'Experimental Design', 1, 'Study of variables, control techniques, and validity in experimental research.', 12, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (35, 'Qualitative Methods', 2, 'Examination of interviews, focus groups, and thematic analysis in psychological research.', 12, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
INSERT INTO "lesson" ("id", "title", "order", "content", "moduleId", "createdAt", "updatedAt") VALUES (36, 'Ethics in Research', 3, 'Analysis of ethical principles, informed consent, and research with vulnerable populations.', 12, '2025-05-04T22:53:04.383Z', '2025-05-04T22:53:04.383Z');
